CREATE DEFINER=`root`@`localhost` PROCEDURE `ContarComprasUsuario` (IN `usuarioID` INT, OUT `cantidadCompras` INT)   BEGIN
    DECLARE done INT DEFAULT FALSE;
    DECLARE total INT DEFAULT 0;
    DECLARE cur CURSOR FOR 
        SELECT id FROM compras WHERE usuario_id = usuarioID;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    OPEN cur;
    read_loop: LOOP
        FETCH cur INTO total;
        IF done THEN
            LEAVE read_loop;
        END IF;
        SET cantidadCompras = cantidadCompras + 1;
    END LOOP;
    CLOSE cur;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `ObtenerProductosOrdenadosPorNombre` ()   BEGIN
    SELECT * FROM productos ORDER BY nombre;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `ObtenerProductosOrdenadosPorPrecio` ()   BEGIN
