INSERT INTO `informacion_empresa` (`id`, `historia`, `valores`) VALUES
(1, 'YLK IND es una marca nacida de la pasión por la innovación, y del compromiso de un equipo por ofrecer soluciones avanzadas que distingan sus productos. El objetivo está definido en la mejora del proceso de comercialización y comunicación de cualquier artículo sobre el que se aplica una etiqueta. Entender la etiqueta como herramienta de márketing es la clave para tratar de generar valor añadido en el proceso de comunicación de la marca, identidad corporativa, y otros atributos del branding hacia el consumidor. Qué y cómo perciba la marca el consumidor es una de las cuestiones más importantes en ese proceso de comunicación.\n\nEl ímpetu por conseguir la máxima calidad en todos los detalles es lo que define principalmente a YLK IND, como empresa de etiquetaje. Este proyecto cuenta ya con una trayectoria de más de 40 años. Fue a principios de los 70 cuando todo empezó, y desde entonces, paso a paso se ha ido consolidando el desarrollo hasta alcanzar la situación actual, en la que el proyecto se encuentra internacionalizado, y cuenta con una amplia oferta de etiquetas (etiquetas tejidas, etiquetas colgantes, etiquetas de composición, etiquetas adhesivas, etiquetas RFID, …), que ofrecen soluciones de codificación e identificación y cumplen con las necesidades de todos los productos del retail textil-moda, calzado, marroquinería o complementos del vestir.\n\nLa estrategia empresarial está basada en la mejora continua en todos los ámbitos, desde el comercial hasta el productivo. La empresa apuesta por las nuevas tecnologías, por el desarrollo de producto, por la internacionalización, el respeto del medio ambiente y por la cercanía con el cliente para comprender bien cuáles son las necesidades, y poder así satisfacerlas. Estas son las bases que han mantenido este proyecto de forma sostenible durante todos estos años, y sobre los que seguirá desarrollando el crecimiento futuro.', 'Los valores suponen el ADN de la empresa. Es el código por el que se rigen todas las personas que forman parte del equipo de ETI – TEXTIL, y a través de los cuales justifican y encuentran la razón de ser en el día a día.\r\n\r\nLos principales valores de ETI – TEXTIL son :\r\n\r\nProfesionalidad\r\nUno de los principales valores añadidos es la profesionalidad del equipo de trabajo, que entiende la etiqueta como una herramienta de comunicación en el producto. Por ello, en su día a día trabaja con el objetivo de crear y producir las etiquetas con los mayores estándares de calidad e innovación.\r\n\r\nLiderazgo\r\nEn ETI-TEXTIL, el concepto de liderazgo es entendido como la vocación constante de orientación y servicio al cliente. Por ello, todas las operaciones y procesos han sido minuciosamente diseñados considerando las necesidades e inquietudes del cliente. Entender este concepto de esta forma es lo que ha consolidado a ETI-TEXTIL como un punto de referencia en el sector de la etiqueta en Europa.\r\n\r\nDinamismo\r\nTodas las operaciones y procesos están diseñados en un entorno dinámico y en constante evolución. Bajo los más altos estándares de diseño, innovación, producción e internacionalización… el cliente tiene a su disposición soluciones creativas y avanzadas para la gestión de su etiquetaje de forma dinámica en un entorno global.\r\n\r\nProactividad\r\nExiste el objetivo de la anticipación a las necesidades del mercado, del cliente, y del producto en sí mismo. Este valor de la proactividad se gestiona en distintos niveles:\r\n\r\n1 – Desarrollo de nuevos productos y soluciones. Contamos con un departamento de I+D+i que está en constante evolución para aportar las propuestas y soluciones más innovadoras.\r\n\r\n2 – Desarrollo de sistemas de gestión online que facilitan la comunicación con el cliente, proporcionando abundante información de calidad y valor para el mismo.\r\n\r\n3 – Implantación de un sistema de calidad documentado que garantiza que el proceso se encuentra dentro de los estándares definidos.\r\n\r\n4 – Control de todos los procesos mediante sistemas asistidos por código de barras para anticipar cualquier incidencia que pueda producirse en la producción.\r\n\r\nCompromiso\r\nEl mayor compromiso es su satisfacción. Puede contar con un producto de excelente calidad, diseño e innovación, que seguro cumplirá sus expectativas y atenderá las necesidades de su producto, mejorando su comunicación y presentación en el mercado. Todo el equipo humano de ETI – TEXTIL que gestiona este proyecto trabaja día a día en la búsqueda de su satisfacción.\r\n\r\nGeneración de valor añadido para nuestros clientes\r\nLa pasión por la innovación es la que ha permitido cumplir año tras año el objetivo : ser una fuente de valor añadido para todos los clientes. Existe el compromiso de aportar valor a través del etiquetaje, y gracias a esta premisa, existe un control muy estricto y cercano de todo el proceso: desde la comercialización, para comprender bien las necesidades del producto, hasta los acabados, donde la aplicación correcta de estos procesos permite producir etiquetas con texturas y tacto suave que acaban siendo la diferencia.\r\n\r\nIlusión\r\nLa ilusión es el componente que marca la diferencia. Es lo que convierte un producto bueno en excelente. La ilusión está presente en todo el equipo humano de ETI – TEXTIL para que junto al resto de valores, los productos y soluciones ofrecidas sean todo lo buenos que pueden ser. La pasión por el detalle y el compromiso por el trabajo bien hecho de to el equipo permite elevar día a día los estándares de calidad.');

